-- Supprime les tables s'il elles existent déjà
DROP TABLE IF EXISTS masters, academies, communes, regions;

-- Table pour les masters
CREATE TABLE masters(
    id_etablissement INTEGER NOT NULL, -- Identifiant de l'établissement (clé primaire)
    type_etablissement VARCHAR(20), -- Type d'établissement
    etablissement VARCHAR(100), -- Nom de l'établissement
    type_diplome VARCHAR(50), -- Type de diplôme
    regroupement_diplomes VARCHAR(50), -- Regroupement des diplômes
    libelle_diplome VARCHAR(100), -- Libellé du diplôme
    grande_discipline VARCHAR(50), -- Grande discipline
    secteur_disciplinaire VARCHAR(50), -- Secteur disciplinaire
    nb_etudiants INTEGER, -- Nombre total d'étudiants
    nb_femmes INTEGER, -- Nombre de femmes
    nb_hommes INTEGER, -- Nombre d'hommes
    code_commune  VARCHAR(50), -- Code de la commune
    commune VARCHAR(50), -- Nom de la commune
    departement VARCHAR(50), -- Département
    id_academie VARCHAR(50), -- Identifiant de l'académie
    académie VARCHAR(50), -- Nom de l'académie
    id_region VARCHAR(50), -- Identifiant de la région
    region VARCHAR(50), -- Nom de la région
    CodeUAI VARCHAR(50), -- Code UAI
    etablissement_actuel VARCHAR(100), -- Nom de l'établissement actuel
    PRIMARY KEY (id_etablissement) -- Clé primaire
);

-- Table pour les académies
CREATE TABLE academies(
    id_academie VARCHAR(5) NOT NULL, -- Identifiant de l'académie (clé primaire)
    academie VARCHAR(50), -- Nom de l'académie
    PRIMARY KEY(id_academie) -- Clé primaire
);

-- Table pour les communes
CREATE TABLE communes(
    id_commune VARCHAR(5) NOT NULL, -- Identifiant de la commune (clé primaire)
    commune VARCHAR(50), -- Nom de la commune
    PRIMARY KEY(id_commune) -- Clé primaire
);

-- Table pour les régions
CREATE TABLE regions(
    id_region VARCHAR(5) NOT NULL, -- Identifiant de la région (clé primaire)
    region VARCHAR(50), -- Nom de la région
    PRIMARY KEY(id_region) -- Clé primaire
);

